import Search from '../comps/search';
const SideBar = props => (
  <div>
    <div className="sideBarBox">
        <h3> SIDEBAR</h3>
        <Search className="seachBarMain"/>
    </div>

    <style jsx>{`
    .searchBarMain{
      position:relative;
    }
    .sideBarBox{
    padding: 0;
    margin: 0;
    height: 100vh;
    color: #1DB954;
    background: black;
    position: relative;
    top: -10px;
  }
    `}
    </style>
  </div>
);

export default SideBar;
